                <p class="ot-category-desc" id="ot-desc-id-C4S1">Ces cookies nous permettent ainsi qu’à nos partenaires de vous proposer des publicités personnalisées, plus adaptées à vos centres d'intérêt, d'enregistrer votre visite sur notre Site, les pages que vous avez consultées ainsi que les liens que vous avez suivis. Nous utilisons ainsi que nos partenaires, ces informations afin de rendre notre Site ainsi que les publicités qui y figurent, le cas échéant, les plus pertinents possibles au regard de vos centres d’intérêt. Ils peuvent également servir à afficher des publicités personnalisées à propos de nos produits sur d’autres sites, à mesurer l'efficacité d'une campagne publicitaire, à limiter la fréquence de diffusion (c'est-à-dire à limiter le nombre de fois que vous voyez une publicité), l'affiliation publicitaire, la détection de la fraude au clic, les études de marché, l'amélioration des produits, le débogage. En refusant ces cookies, nous ne serons pas en mesure de personnaliser les publicités que vous verrez.<br> </p>
