                    <h3 id="onetrust-policy-title">Cetelem et ses partenaires souhaitent utiliser des cookies avec votre accord préalable</h3>
                    <p id="onetrust-policy-text"></p>
                    <p tabindex="0">Les cookies sont utilisés pour sécuriser votre connexion, garantir le bon fonctionnement du site, faciliter votre navigation, permettre l’élaboration de statistiques et proposer des offres personnalisées au travers de publicités.</p>
                    <h4>Cookies utilisés :</h4>
                    <p>Fonctionnement (obligatoires) : ces cookies sont nécessaires et garantissent le bon fonctionnement du site et permettent son optimisation.<br>
                      Statistiques et mesures d’audience : ces cookies permettent d'établir des statistiques d'analyse de la fréquentation à partir desquels les contenus de notre site sont améliorés.<br>
                      Cookies de publicité : ces cookies permettent de mieux connaître vos centres d'intérêt et de vous proposer des publicités personnalisées adaptées à vos attentes.<br>
                      Cookies des réseaux sociaux : ces cookies permettent d'interagir avec les boutons des réseaux sociaux présents sur notre site.<br>
                      Cookies de préférence : permet de personnaliser et proposer les contenus et fonctionnalités des sites.<br>
                    </p>
                    <p>
                      Vous pouvez à tout moment modifier ou retirer votre consentement à l’installation de cookies non strictement nécessaires.<br>
                      Pour obtenir plus d’informations sur les cookies utilisés et la liste des sociétés utilisant des traceurs sur notre site, vous pouvez consulter notre politique des cookies :
                    </p><a href="https://www.cetelem.fr/fr/cookies">Politique des cookies</a>
